import { useState } from 'react';
import { Form } from 'react-bootstrap'

import './searchCar.css'

function SearchCar( {carsData} ) {
  const [search, setSearch] = useState('')

  return (
    <div className="search">
    <Form.Control type="text" placeholder="Readonly input here..." oneChange={event => {setSearch(event.target.value)}} />

    {carsData.filter((val) => {
      if (search == "") {
      return val
    } else if (val.BRAND.toLowerCase().includes(search.toLowerCase())) {
      return val
    }
    }).map((val, key) => {
      return (
        <p>
        {val.BRAND}
        </p>

      )
    })}
    </div>
  );
}

export default SearchCar;
